import pygame
import random
from pathfinding.core.grid import Grid
from pathfinding.finder.a_star import AStarFinder
from pathfinding.core.diagonal_movement import DiagonalMovement
pygame.init() 

TILE_SIZE = 8  # adjust to your scaling

# -------------------------------
# PATHFINDER CLASS
# -------------------------------
class Pathfinder:
    def __init__(self, matrix):
        self.matrix = matrix
        self.grid = Grid(matrix=matrix)

    def create_path(self, start_xy, end_xy):
        """ start_xy and end_xy are (x, y) tuples in grid coordinates """
        start_node = self.grid.node(start_xy[0], start_xy[1])
        end_node = self.grid.node(end_xy[0], end_xy[1])
        finder = AStarFinder(diagonal_movement=DiagonalMovement.always)
        path, _ = finder.find_path(start_node, end_node, self.grid)
        self.grid.cleanup()
        return path

# -------------------------------
# PLANE CLASS
# -------------------------------
class Plane(pygame.sprite.Sprite):
    def __init__(self, image_path="myFavplane.png"):
        super().__init__()
        self.image = pygame.image.load(image_path).convert_alpha()
        self.rect = self.image.get_rect()
        self.pos = pygame.math.Vector2(self.rect.center)

        self.speed = 0.6
        self.direction = pygame.math.Vector2(0, 0)
        self.moving = True

        self.path = []
        self.collision_rects = []
        self.checkpoints = []  # grid coordinates where plane stops

    def set_path(self, path, start_pixel=None):
        self.path = path
        self.create_collision_rects()
        if start_pixel:
            self.pos = pygame.math.Vector2(start_pixel)
            self.rect.center = self.pos
        self.get_direction()
        self.moving = True

    def create_collision_rects(self):
        self.collision_rects = []
        for point in self.path:
            x = point[0] * TILE_SIZE + TILE_SIZE // 2
            y = point[1] * TILE_SIZE + TILE_SIZE // 2
            rect = pygame.Rect(x-2, y-2, 4, 4)
            self.collision_rects.append(rect)

    def get_direction(self):
        if self.moving and self.collision_rects:
            start = pygame.math.Vector2(self.pos)
            end = pygame.math.Vector2(self.collision_rects[0].center)
            if (end - start).length() != 0:
                self.direction = (end - start).normalize()
            else:
                self.direction = pygame.math.Vector2(0, 0)
        else:
            self.direction = pygame.math.Vector2(0, 0)

    def check_collisions(self):
        if not self.collision_rects:
            return

        # stop at checkpoints
        current_grid = (int(self.pos.x // TILE_SIZE), int(self.pos.y // TILE_SIZE))
        if current_grid in self.checkpoints:
            self.moving = False
            self.direction = pygame.math.Vector2(0, 0)
            return

        # move to next node if reached collision rect
        if self.collision_rects[0].collidepoint(self.pos):
            self.collision_rects.pop(0)
            self.get_direction()

    def update(self):
        if self.moving:
            self.pos += self.direction * self.speed
        self.check_collisions()
        self.rect.center = self.pos


