# Create Pathfinder instance
pathfinder = Pathfinder(matrix)

# Pick random start gate and runway
start = random.choice(pts)
end = random.choice(fpts)

# Generate path
path = pathfinder.create_path(start, end)

# Convert start to pixels for plane spawn
plane_pixel = (start[0]*TILE_SIZE + TILE_SIZE//2, start[1]*TILE_SIZE + TILE_SIZE//2)

# Create plane and set path
plane = Plane()
plane.set_path(path, start_pixel=plane_pixel)

# Add to sprite group
plane_group = pygame.sprite.Group()
plane_group.add(plane)


running = True
screen = pygame.display.set_mode((1280, 800))
clock = pygame.time.Clock()

while running:
    for event in pygame.event.get():
        if event.type == pygame.QUIT:
            running = False
        elif event.type == pygame.KEYDOWN:
            if event.key == pygame.K_SPACE:
                for p in plane_group:
                    p.moving = not p.moving
                    p.get_direction()

    screen.fill((30,30,30))
    plane_group.update()
    plane_group.draw(screen)
    pygame.display.flip()
    clock.tick(60)
